pragma solidity ^0.5.0;

import "./ERC721Full.sol";

contract NFTrade is ERC721Full {
  constructor() ERC721Full("NFTrade Token", "NFTRADE") public {
  }

  function mint(address _to, string memory _tokenURI) public returns(bool) {
    uint _tokenId = totalSupply().add(1);
    _mint(_to, _tokenId);
    _setTokenURI(_tokenId, _tokenURI);
    return true;
  }

  // Store Images
  uint public imageCount = 0;
  mapping(uint => Image) public images;

  struct Image {
    uint id;
    string hash;
    string description;
    uint imgPrice;
    address payable author;
    address payable imgOwner;
  }

  event ImageCreated(
    uint id,
    string hash,
    string description,
    uint imgPrice,
    address payable author,
    address payable imgOwner
  );

  event ImageBought(
    uint id,
    string hash,
    string description,
    uint imgPrice,
    address payable author,
    address payable imgOwner
  );

  // Create NFT image
  function uploadImage(string memory _imgHash, string memory _description) public {
    // Make sure image hash exists
    require(bytes(_imgHash).length > 0);

    // Make sure image description exists
    require(bytes(_description).length > 0);

    // Make sure upploader address exists
    require(msg.sender != address(0x0));
    
    // Increment image id
    imageCount ++;

    // Add Image to contract
    images[imageCount] = Image(imageCount, _imgHash, _description, 1, msg.sender, msg.sender);
    
    // Trigger an event
    emit ImageCreated(imageCount, _imgHash, _description, 1, msg.sender, msg.sender);
  }

  // in development

      event Transfer(
        address indexed _from,
        address indexed _to,
        uint256 _value
    );

    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );

  mapping(address => uint256) public _balanceOf;
  mapping(address => mapping(address => uint256)) public allowance;

  function approveTest(address _spender, uint256 _value) public returns (bool success) {
      allowance[msg.sender][_spender] = _value;
      emit Approval(msg.sender, _spender, _value);
      return true;
    }

  function transferFromERC20(address _from, address _to, uint256 _value) public returns (bool success) {
      require(_value <= _balanceOf[_from]);
      require(_value <= allowance[_from][msg.sender]);
      _balanceOf[_from] -= _value;
      _balanceOf[_to] += _value;
      allowance[_from][msg.sender] -= _value;
      emit Transfer(_from, _to, _value);
      return true;
    }  

  function buyItem(uint _id, address payable _buyer) public payable {
    // Make sure the id is valid
    require(_id > 0 && _id <= imageCount);
    
    // Fetch the image
    Image memory _image = images[_id];

    // Fetch the owner
    address payable _owner = _image.imgOwner;

    // Pay the owner, obtain Item
    transferFromERC20(_buyer, _owner, _image.imgPrice);
    safeTransferFrom(_owner, _buyer, _id);

    emit ImageBought(imageCount, _image.hash, _image.description, 1, _image.author, _buyer);
  }
}
